import React from 'react';
import TaskProps from './TaskProps';
import NewTask from './NewTask';

function Task({index, t}) {
    return (
        <div>
            <NewTask />
            <ul>
                <li>{t.name}</li>
            </ul>
        </div>
    );
}

export default Task;
